import React, { Suspense, lazy } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LandingPage from '../pages/LandingPage';

import Dashboard from '../pages/LandingPage';
import Reports from '../pages/Reports';
import AdvancedSearch from '../pages/AdvancedSearch';
import CreateBacklogCase from '../pages/CreateBacklogCase';
import CreateCase from '../pages/CreateCase';
import CourtNames from '../pages/CourtNames';
import CaseDefendants from '../pages/CaseDefendants';
import BacklogCase from '../pages/BacklogCase';
import CaseActivities from '../pages/CaseActivities';
import AllCases from '../pages/AllCases';
import OngoingCases from '../pages/OngoingCases';
import AwaitingAssignment from '../pages/AwaitingAssignment';
import CaseAssistance from '../pages/CaseAssistance';
import Messages from '../pages/Messages';

import MainContainer from '../Structure/MainContainer';
import Header from '../Structure/Header';
import Sidebar from '../Sidebar';
import Wrapper from '../Structure/Wrapper';

const Routers = () => {
    return (
        <BrowserRouter>
            <MainContainer>
                <Header />
                <Sidebar />
                <Wrapper>
                    <Routes>
                        <Route path="/">
                            <Route index element={<LandingPage />} />
                            <Route
                                path="analytics"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <Dashboard />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="reports"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <Reports />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="advanced-search"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <AdvancedSearch />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="new-backlog-case"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <CreateBacklogCase />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="create-case"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <CreateCase />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="court-names"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <CourtNames />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="case-defendants"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <CaseDefendants />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="backlog-case"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <BacklogCase />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="case-activities"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <CaseActivities />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="all-cases"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <AllCases />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="ongoing-cases"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <OngoingCases />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="awaiting-assignment"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <AwaitingAssignment />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="case-assistance"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <CaseAssistance />
                                    </React.Suspense>
                                }
                            />
                            <Route
                                path="messages"
                                element={
                                    <React.Suspense fallback={<>...</>}>
                                        <Messages />
                                    </React.Suspense>
                                }
                            />
                        </Route>
                    </Routes>
                </Wrapper>
            </MainContainer>
        </BrowserRouter>
    );
};

export default Routers;
